public class reconstruct_original_digits_from_english {
    //backtracking
    //zero, one, two, three, four, five, six, seven, eight, nine
    //unique - zero, six, eight (s, x, g)
    //recurse on everything else - try removing some set, if it doesn't work (base case) backtrack
    //base case - if no words can be made and string is not empty, return
    //keep an int[26] array to keep count of everything for efficient removal

    public static class Solution {
        //backtracking is very inefficient - use algorithm based on string uniqueness

        public String originalDigits(String s) {
            int[] count = new int[10];

            for (int i = 0; i < s.length(); i++){
                switch(s.charAt(i)){
                    case 'z':
                        count[0]++; break;
                    case 'w':
                        count[2]++; break;
                    case 'u':
                        count[4]++; break;
                    case 'x':
                        count[6]++; break;
                    case 'g':
                        count[8]++; break;
                    case 'f':
                        count[5]++; break;//subtract count[4] later
                    case 'v':
                        count[7]++; break;//subtract count[5] later
                    case 'h':
                        count[3]++; break;//subtract eight later
                    case 'i':
                        count[9]++; break;//subtract five six and eight later
                    case 'o':
                        count[1]++; break;//subtract zero, two, four later
                }
            }
            count[5] -= count[4];
            count[7] -= count[5];
            count[3] -= count[8];
            count[9] -= count[5] + count[6] + count[8];
            count[1] -= count[0] + count[2] + count[4];

            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < count.length; i++){
                for (int j = 0; j < count[i]; j++){
                    sb.append(String.valueOf(i));
                }
            }
            return sb.toString();
        }
    }

    static public void main(String[] args){
        Solution s = new Solution();
        System.out.println(s.originalDigits(""));
    }
}
